import React, { useState } from 'react';
import Navbar from '../../Components/Navbar/NavBar';

const BlitzPay = () => {
  const [activeTab, setActiveTab] = useState('pending');

  const pendingTransactions = [
    {id: 1, name: 'Lorem', amount: '$200'},
    // More transactions...
  ];

  const allTransactions = [
    {id: 2, name: 'Ipsum', amount: '$300'},
    // More transactions...
  ];

  const recentPayments = [
    {id: 3, name: 'Dolor', amount: '$100'},
    // More payments...
  ];

  const handleTabClick = (tab) => {
    setActiveTab(tab);
  };

  return (
    <div className="dashboard">
      <Navbar />
      <div className="content">
        
      <h1 className='header'>Invoicing</h1>
        <div className="button-container" style={{ marginBottom: '10px' }}>
          <button onClick={() => handleTabClick('pending')}>Pending Transactions</button>
          <button onClick={() => handleTabClick('all')}>All Transactions</button>
          <button onClick={() => handleTabClick('recent')}>Recent Payments</button>
        </div>
        <div className='table-container'>
          {activeTab === 'pending' && (
            <table>
              <thead>
                <tr><th>ID</th><th>Name</th><th>Amount</th></tr>
              </thead>
              <tbody>
                {pendingTransactions.map(transaction => (
                  <tr key={transaction.id}>
                    <td>{transaction.id}</td>
                    <td>{transaction.name}</td>
                    <td>{transaction.amount}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}

          {activeTab === 'all' && (
            <table>
              <thead>
                <tr><th>ID</th><th>Name</th><th>Amount</th></tr>
              </thead>
              <tbody>
                {allTransactions.map(transaction => (
                  <tr key={transaction.id}>
                    <td>{transaction.id}</td>
                    <td>{transaction.name}</td>
                    <td>{transaction.amount}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}

          {activeTab === 'recent' && (
            <table>
              <thead>
                <tr><th>ID</th><th>Name</th><th>Amount</th></tr>
              </thead>
              <tbody>
                {recentPayments.map(payment => (
                  <tr key={payment.id}>
                    <td>{payment.id}</td>
                    <td>{payment.name}</td>
                    <td>{payment.amount}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
          </div>
        </div>
      </div>
  );
};

export default BlitzPay;
